import { apiUrl, apiUrl2, requestHeaders } from "../Constants/GeneralCont";
import axios from "axios";

export function GetAllNewOrders(){
    var params = new URLSearchParams();
    params.append("CheckTypeFunction", "GetAllNewOrders");

    return axios.post(apiUrl2, params, {headers: requestHeaders});
}

export function GetAllActiveOrders(){
    var params = new URLSearchParams();
    params.append("CheckTypeFunction", "GetAllActiveOrders");

    return axios.post(apiUrl2, params, {headers: requestHeaders});
}

